    <div className="App">
      <h1>Hi , {IsNameShowing ? name : "Stranger"} here from react</h1>
      {name ?(
        <>
        {name}
        </>
      ):(
        <>
        <h1>Test</h1>
        <h2>Name</h2>
        </>
      )}
    </div>
  );
}

export default App;
